const initialState = {
    name: null,
    title: null,
}
const reducer = (state = initialState, action) => {
    switch (action.type) {
        case "name": return { ...state, name: action.value };
        case "title": return { ...state, title: action.value }
    }
    return state;
}
export default reducer;
